import {data} from "./data"
import {BrowserRouter as Router, Routes, Route, Link} from "react-router-dom"
function Home() {
    return (
        <div>
            {JSON.stringify(data)}
        </div>
    )
}
function About() {
    return <h1>About</h1>
}
export default function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home/>} />
                <Route path="/about" element={<About/>} />
            </Routes>
        </Router>
    )
}
